import React from 'react';


const style = {
    width:"40vw",
    display:"block",
    textAlign:"center",
    borderTop:"2px solid black",
    marginTop:"20px"
}
const Footer = () => {
    return (
        <div style={style}>
            <a href='https://www.freepik.com/vectors/data'>Data vector created by stories - www.freepik.com</a>
        </div>
    )
}

export default Footer;
